import React, {Component} from "react";

class Banner extends Component {
  render() {
    const title ='Pure Bootstrap';
    const spanData  = 'Website';
    return (
      <>
       <div className="banner-container">
        <div className="banner">
        <div class="col-sm-15 text-center">
        <h1 class="display-2 text-capitalize">
                         <span class="text-warning">{title}</span>
                         <span class="text-white font-weight-bold">{spanData}</span>
                     </h1>
                      <p class="font-weight-light font-italic text-light">
                         Lorem, ipsum dolor sit amet consectetur adipisicing elit. Amet, tempore.</p>
                     
                   <a href="#" class="btn btn-warning btn-lg px-4 m-3">Press Here</a>
                     <a href="#" class="btn btn-danger btn-lg px-4 m-3">Press Here</a>
        </div>
      </div>
      </div>
      </>
    )
  }
}
 export default Banner;


